import React from "react";
import { v4 as chave } from 'uuid';


export default function ListaContato({listaContato}) {
    return (
        <>
            <ul>
                {listaContato.map(contato => {
                    return <li>{contato.nome+ ' ' +contato.telefone}</li>
                })}
            </ul>            
        </>
    )
}
